import React from "react";
import classes from '../styles/homePage.module.css'
// import Images from  '../image/images.js'
import backgroundImage from '../image/image2.jpg'; 


function HomePage() {
    // <img src={Images.backgroundImage} alt='backgroundImage'></img>
    return (

        <div className={classes.zones}>
            <div className={classes.zone_green}>Video</div>
            <div className={classes.zone_red}>Who are we</div>
            <div className={classes.zone_blue}>Announcements</div>
            <div className={classes.zone_red}>Picture slides</div>
            <div className={classes.zone_yellow}>Footer</div>   
    </div>

    );
}

export default HomePage;
